import './style.css';

const MyItemsTable = () => {
  return (
    <div className="my-items">
      <table>
        <colgroup>
          <col style="min-width: 150px" />
          <col style="min-width: 80px" />
          <col style="min-width: 80px" />
          <col style="min-width: 80px" />
          <col style="min-width: 80px" />
          <col style="min-width: 80px" />
          <col style="min-width: 150px" />
        </colgroup>
        <thead>
          <tr>
            <th>Item</th>
            <th>Shop</th>
            <th>Price</th>
            <th>Expected price</th>
            <th>Tracked</th>
          </tr>
        </thead>
        <tbody>
          {Row}
          {Row}
          {Row}
        </tbody>
      </table>
    </div>
  );
};

const Row = () => {
  return (
    <tr>
      <td>Sukienka mini</td>
      <td>zara</td>
      <td>120PLN</td>
      <td>100PLN</td>
      <td></td>
    </tr>
  );
};

export default MyItemsTable;
